    return(
        <div>
            <h1>My car name is {carName}</h1>
            <button onClick={()=>setCarName("BMW")}>click meeee</button>
            <h1>The count is {count}</h1>
            <button onClick={changeCount}>increment</button>
            <button onClick={()=>setCount(count-1)}>decrement</button>
        </div>
    )
}
